import React, { useState } from "react";
import { View, TextInput, Button } from "react-native";
import {signUp, errorMessage, setFirstName, setLastName, setPhoneNumber, setEmail, setPassword} from '../user-management/Firebase_Helper';
import {Stack} from '../../App'
import { useNavigation, NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

const [firstName, setFirst] = useState('');
const [lastName, setLast] = useState('');
const [phoneNumber, setNumber] = useState('');
const [email, setemail] = useState('');
const [password, setPass] = useState('');

function SignUpScreen ({ navigation: { navigate } }) {

  return (
    <View>
      <TextInput
        style={{height: 40}}
        placeholder="First Name"
        onChangeText={firstName => setFirst(firstName)}

      />

      <TextInput
        style={{height: 40}}
        placeholder="Last Name"
        onChangeText={lastName => setLast(lastName)}

      />
      <TextInput
        style={{height: 40}}
        placeholder="Phone Number"
        onChangeText={phoneNumber => setNumber(phoneNumber)}

      />
       <TextInput
        style={{height: 40}}
        placeholder="Email Address"
        onChangeText={email => setemail(email)}

      />
       <TextInput
        style={{height: 40}}
        placeholder="Password"
        onChangeText={password => setPass(password)}

      />
      <Button 
        title = 'Already Have An Account'
        onPress={() => navigate('Login')}
      /> 

      <Button 
        title = 'Sign Up'
        onPress={() => 
        signUp()  
        }
        />  
    </View>
  )
};
function siginUp () {
  setFirstName(firstName)
  setLastName(lastName)
  setPhoneNumber(phoneNumber)
  setEmail(email)
  setPassword(phoneNumber)

  navigate('Main')
}
export default SignUpScreen;
